	add("endearment", "{\"term\":\"endearment\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|endear|ment|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act or process of endearing, of causing (something or someone) to be loved or to be the object of affection\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1913\u0027\u0027, w:William MacLeod William MacLeod Raine, \u0027The Vision Splendid\u0027, ch. 20\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Every step of that walk led Jeff deeper into an excursion of \u0027\u0027endearment\u0027\u0027. It was amazingly true that he trod beside her an acknowledged friend, a secret lover\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The state or characteristic of being endeared\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1855\u0027\u0027, w:Elizabeth Elizabeth Gaskell, \u0027North and South\u0027, ch. 38\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"He could not forget the fond and earnest look that had passed between her and some other man—the attitude of familiar confidence, if not of positive \u0027\u0027endearment\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"An expression of affection\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1902\u0027\u0027, w:Gertrude Franklin Horn Gertrude Franklin Horn Atherton, \u0027The Conqueror\u0027, ch. 18\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"When they were alone he called him \u0026quot;my boy,\u0026quot; an \u0027\u0027endearment\u0027\u0027 he never gave another\", \"priority\":9}]}, \"synonyms\":{}}");

	add("endeavor", "{\"term\":\"endeavor\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"middle english (1100-1500)\", \"middle french (ca. 1400-1600)\", \"old french (842-ca. 1400)\"], \"text\":\"The verb is from Middle english (1100-1500) \u0027endeveren\u0027 (to make an effort) the noun is from Middle english (1100-1500) \u0027endevour\u0027 from the verb. \u0027endeveren\u0027 is from \u0027putten in dever\u0027 from \u0027in\u0027 + \u0027dever\u0027 () partially translating Middle french (ca. 1400-1600) \u0027\u0027 ((se mettre) en devoir (de faire)) (from Old french (842-ca. 1400) \u0027devoir\u0027 \u0027deveir\u0027 (duty) .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A sincere attempt; a determined or assiduous effort towards a specific goal\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1640\u0027\u0027, w:Thomas Thomas Hobbes, \u0027s:The Elements of Law/Part II/Chapter The Elements of Law\u0027, part II, chapter 28\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"And these three: 1. the law over them that have sovereign power; 2. their duty; 3. their profit: are one and the same thing contained in this sentence, \u0027Salus populi suprema lex\u0027; by which must be understood, not the mere preservation of their lives, but generally their benefit and good. So that this is the general law for sovereigns: that they procure, to the uttermost of their \u0027\u0027endeavour\u0027\u0027, the good of the people\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1873\u0027\u0027, w:James Clerke J C Maxwell, s:A Treatise on Electricity and \u0027A Treatise on Electricity and Magnetism\u0027, volume 2, page 184\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"As we shall find it necessary, in our \u0027\u0027endeavours\u0027\u0027 to bring electrical phenomena within the province of dynamics, to have our dynamical ideas in a state fit for direct application to physical questions we shall devote this chapter to an exposition of these dynamical ideas from a physical point of view\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Enterprise; assiduous or persistent activity\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1748\u0027\u0027, David Hume, \u0027Enquiries concerning the human understanding and concerning the principles of moral\u0027 (London: Oxford University Press, 1973), § 9\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The like has been the \u0027\u0027endeavour\u0027\u0027 of critics, logicians, and even politicians\", \"priority\":8}]}, \"synonyms\":{}}");

