	add("endomorph", "{\"term\":\"endomorph\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{sense|physical type}} Derived from \u0027endoderm\u0027 {{suffix||morph|lang\u003den}} from w:William Herbert Sheldon|William Herbert Sheldon.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A mineral, especially a crystal, enclosed within anothe\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A person of the endomorphic physical type characterised by big bones, round face, large trunk and thighs and a naturally high degree of body fat, especially around the midsection. Endomorphs usually struggle to control their weight although it may simply mean more determination is needed for an endomorph to lose as much weight as a mesomorph\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Theoretical body type with slow metabolism in which weight is gained easily, but fat levels are hard to reduce. Endomorphic bodybuilders tend to be the most massive\", \"priority\":3}]}, \"synonyms\":{}}");

