	add("endowment", "{\"term\":\"endowment\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Something with which a person or thing is endowed\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1791\u0027\u0027, q:Benjamin Benjamin Banneker, Letter to Thomas Jefferson on racism and slavery (19 August 1791\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"I suppose it is a truth too well attested to you, to need a proof here, that we are a race of beings, who have long labored under the abuse and censure of the world; that we have long been looked upon with an eye of contempt; and that we have long been considered rather as brutish than human, and scarcely capable of mental \u0027\u0027endowments\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1958\u0027\u0027, q:Adlai Adlai Stevenson, Speech to the United Parents Association\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"We must not, in opening our schools to everyone, confuse the idea that all should have equal chance with the notion that all have equal \u0027\u0027endowments\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1980\u0027\u0027, Ray Broadus Browne, \u0027Rituals and ceremonies in popular culture\u0027, page 230\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"the woman with larger-than-usual breasts will be initially perceived \u0027only\u0027 as a sex object if she doesn\u0027t take steps to disguise her \u0027\u0027endowment\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1985\u0027\u0027, q:Jonas Jonas Salk, Interview on \u0027The Open Mind\u0027 (11 May 1985\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"What is … important is that we — number one: Learn to live with each other. Number two: try to bring out the best in each other. The best from the best, and the best from those who, perhaps, might not have the same \u0027\u0027endowment\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Natalie R. Collins, \u0027Wives and Sisters\u0027, page 54\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Tami also had huge breasts, and every teenage boy wanted to touch them. Tami, knowing she was not beautiful, used her \u0027\u0027endowment\u0027\u0027 to great advantage\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Property or funds invested for the support and benefit of a person or not-for-profit institution\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"1884\u0027\u0027, q:Edwin Abbott Edwin Abbott Abbott, in chapter 8 of his novella \u0027Flatland\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Not content with the natural neglect into which Sight Recognition was falling, they began boldly to demand the legal prohibition of all \u0026quot;monopolizing and aristocratic Arts\u0026quot; and the consequent abolition of all \u0027\u0027endowments\u0027\u0027 for the studies of Sight Recognition, Mathematics, and Feeling\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"1932\u0027\u0027, q:Robert Clarkson Robert Clarkson Clothier, after assuming the presidency of Rutgers, The State University of New Jerse\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"I seem to see a great university, great in \u0027\u0027endowment\u0027\u0027, in land, in buildings, in equipment, but greater still, second to none, in its practical idealism, and its social usefulness\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/finance-and-economics/21580518-terrible-name-interesting-trend-rise-smart-beta The rise of smart passage\u003dInvestors face a quandary. Cash offers a return of virtually zero in many developed countries; government-bond yields may have risen in recent weeks but they are still unattractive. Equities have suffered two big bear markets since 2000 and are wobbling again. It is hardly surprising that pension funds, insurers and \u0027\u0027endowments\u0027\u0027 are searching for new sources of return\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"A form of life insurance paying a lump sum to the policyholder on a fixed date, or to the estate if the policyholder dies before that date\", \"priority\":18}]}, \"synonyms\":{}}");

