	add("endura", "{\"term\":\"endura\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old provençal (to 1500)\"], \"text\":\"from Old provençal (to 1500) \u0027endurar\u0027 (to fast, endure)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A fast or series of privations undertaken by the Cathars to purify the soul, often resulting in death\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1942\u0027\u0027, Rebecca West, \u0027Black Lamb and Grey Falcon\u0027, Canongate 2006, p. 173\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"There was a particularly horrible travesty of extreme unction called the ‘\u0027\u0027endura\u0027\u0027’\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, René Weis, \u0027The Yellow Cross\u0027, Penguin 2001, p. 60\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Guillemette was consoled by the Good Men and went through the \u0027\u0027\u0027endura\u0027\u0027\u0027, the Cathars\u0027 purifying death-fast\", \"priority\":5}]}, \"synonyms\":{}}");

